import { useSelector } from 'react-redux';

const initialState = useSelector(state => state.isLoggedInReducer);

const logoutReducer = (state = initialState, action) => {

    switch (action.type) {
        case "LOGOUT":
            return state = false;
        default:
            return state;
    }

}
export default logoutReducer;
